// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract MedicineTracker {
    struct Medicine {
        string name;
        string batchId;
        string manufacturer;
        uint256 manufacturingDate;
        uint256 expiryDate;
    }

    struct JourneyStep {
        address entity;       // Address of the entity
        string status;        // Status (e.g., "Dispatched", "Received")
        uint256 timestamp;    // Time of the update
    }

    mapping(string => Medicine) public medicines; // Mapping to store medicines by their batch ID
    mapping(string => JourneyStep[]) public journeyDetails; // Mapping for the journey of each medicine
    mapping(address => string) public entityNames; // Mapping to store entity names by address
    mapping(address => bool) public authorizedEntities; // Mapping to store authorized entities

    address public owner;

    // Events
    event MedicineRegistered(
        string batchId,
        string name,
        string manufacturer,
        uint256 manufacturingDate,
        uint256 expiryDate
    );

    event SupplyChainUpdated(
        string batchId,
        address indexed entity,
        string status,
        uint256 timestamp
    );

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can perform this action");
        _;
    }

    modifier onlyAuthorized() {
        require(
            authorizedEntities[msg.sender],
            "Only authorized entities can perform this action"
        );
        _;
    }

    constructor() {
        owner = msg.sender; // Set the deployer as the owner
        authorizedEntities[msg.sender] = true; // The owner is an authorized entity by default
    }

    // Function to add authorized entities
    function addAuthorizedEntity(address _entity) public onlyOwner {
        authorizedEntities[_entity] = true;
    }

    // Function to remove authorized entities
    function removeAuthorizedEntity(address _entity) public onlyOwner {
        authorizedEntities[_entity] = false;
    }

    // Function to register an entity name
    function setEntityName(address _entity, string memory _name)
        public
        onlyOwner
    {
        entityNames[_entity] = _name;
    }

    // Function to register a new medicine
    function registerMedicine(
        string memory _batchId,
        string memory _name,
        string memory _manufacturer,
        uint256 _manufacturingDate,
        uint256 _expiryDate
    ) public onlyAuthorized {
        // Ensure the medicine is not already registered
        require(
            journeyDetails[_batchId].length == 0,
            "Medicine already registered"
        );

        medicines[_batchId] = Medicine({
            name: _name,
            batchId: _batchId,
            manufacturer: _manufacturer,
            manufacturingDate: _manufacturingDate,
            expiryDate: _expiryDate
        });

        emit MedicineRegistered(
            _batchId,
            _name,
            _manufacturer,
            _manufacturingDate,
            _expiryDate
        );
    }

    // Function to update the supply chain
    function updateSupplyChain(string memory _batchId, string memory _status)
        public
        onlyAuthorized
    {
        require(
            bytes(medicines[_batchId].batchId).length > 0,
            "Medicine not registered"
        );

        JourneyStep memory step = JourneyStep({
            entity: msg.sender,
            status: _status,
            timestamp: block.timestamp
        });

        journeyDetails[_batchId].push(step);

        emit SupplyChainUpdated(
            _batchId,
            msg.sender,
            _status,
            block.timestamp
        );
    }

    // Function to get the journey details for a medicine
    function getJourneyDetails(string memory _batchId)
        public
        view
        returns (JourneyStep[] memory)
    {
        return journeyDetails[_batchId];
    }

    // Function to get medicine details
    function getMedicineDetails(string memory _batchId)
        public
        view
        returns (
            string memory,
            string memory,
            string memory,
            uint256,
            uint256
        )
    {
        Medicine memory med = medicines[_batchId];
        return (
            med.name,
            med.batchId,
            med.manufacturer,
            med.manufacturingDate,
            med.expiryDate
        );
    }
}
